import React from 'react';
import './MenuItem.css';

const MenuItem = ({ image, title, link }) => {
  return (
    <div className='card'>
      <div className='cardContent'>
        <img className='img' src={image} alt={title} />
        <p>{title}</p>
      </div>
    </div>
  );
};

export default MenuItem;
